INSERT INTO `v1_6c031190c72116644994087fd38e2fae0e8870548437f56d14ac13527ce71ff0` VALUES ("カオリ（サマー）", 24, 110501, 4, 0.0, 1, 4, 0.0, 24015, "あうぅ～残念さ～\nマジムンに魂を\n奪われちゃったかな～？", "2019/07/31 12:00:00", 10021, 0.0, "2030/12/17 14:59:59");
INSERT INTO `v1_6c031190c72116644994087fd38e2fae0e8870548437f56d14ac13527ce71ff0` VALUES ("カオリ（サマー）", 24, 110501, 4, 4.0, 2, 1, 0.0, 24016, "今日は踊りのキレも悪いよ～\nゴーヤーっぽいもの食べて、元気回復さ～！", "2019/07/31 12:00:00", 10021, 0.0, "2030/12/17 14:59:59");
INSERT INTO `v1_6c031190c72116644994087fd38e2fae0e8870548437f56d14ac13527ce71ff0` VALUES ("カオリ（サマー）", 24, 110501, 4, 0.0, 3, 4, 0.0, 24017, "マジムンだらけで目が回るさ～！\nふらふらさ～！", "2019/07/31 12:00:00", 10021, 0.0, "2030/12/17 14:59:59");
INSERT INTO `v1_6c031190c72116644994087fd38e2fae0e8870548437f56d14ac13527ce71ff0` VALUES ("カオリ（サマー）", 24, 110501, 1, 5.2, 4, 2, 0.0, 24018, "なんくるない、なんくるない\n次、頑張ればいいんだよ～！\n海で泳いで\nリフレッシュするさー！", "2019/07/31 12:00:00", 10021, 0.0, "2030/12/17 14:59:59");
INSERT INTO `v1_6c031190c72116644994087fd38e2fae0e8870548437f56d14ac13527ce71ff0` VALUES ("カオリ（サマー）", 24, 110501, 5, 4.2, 5, 6, 0.0, 24019, "恥ずかしいところ\n見られちゃったね～\n水着？　水着のことじゃないよー？", "2019/07/31 12:00:00", 10021, 0.0, "2030/12/17 14:59:59");
INSERT INTO `v1_6c031190c72116644994087fd38e2fae0e8870548437f56d14ac13527ce71ff0` VALUES ("カオリ（サマー）", 24, 110501, 2, 0.0, 6, 2, 0.0, 24020, "絶好調さ～！　この調子で\n海の平和を取り戻すよ～！\n楽しい夏が待ってるさ～！", "2019/07/31 12:00:00", 10021, 0.0, "2030/12/17 14:59:59");
INSERT INTO `v1_6c031190c72116644994087fd38e2fae0e8870548437f56d14ac13527ce71ff0` VALUES ("カオリ（サマー）", 24, 110501, 1, 6.4, 7, 6, 0.0, 24021, "何匹で襲ってきたって\n私はマブイを落っことさないよ～！\nくしゅん！　あ……\n今のくしゃみで落っこちたかも～？", "2019/07/31 12:00:00", 10021, 0.0, "2030/12/17 14:59:59");
INSERT INTO `v1_6c031190c72116644994087fd38e2fae0e8870548437f56d14ac13527ce71ff0` VALUES ("カオリ（サマー）", 24, 110501, 2, 0.0, 8, 2, 0.0, 24022, "ひーやーさーさー♪\n戦いの後は、踊りを踊って\n気分スッキリさ～！", "2019/07/31 12:00:00", 10021, 0.0, "2030/12/17 14:59:59");
INSERT INTO `v1_6c031190c72116644994087fd38e2fae0e8870548437f56d14ac13527ce71ff0` VALUES ("カオリ（サマー）", 24, 110501, 6, 10.08, 9, 3, 0.0, 24023, "あれ～？　戦ってるうちに\n水着がどっか行っちゃった～？\nねぇキミ、どっかで見なかった～？\nなんで離れるさ～？", "2019/07/31 12:00:00", 10021, 0.0, "2030/12/17 14:59:59");
INSERT INTO `v1_6c031190c72116644994087fd38e2fae0e8870548437f56d14ac13527ce71ff0` VALUES ("カオリ（サマー）", 24, 110501, 1, 5.0, 10, 2, 0.0, 24024, "まだまだ私は元気だよ～！\nマジムンでもなんでも、\nどんとこーいさー♪", "2019/07/31 12:00:00", 10021, 0.0, "2030/12/17 14:59:59");
INSERT INTO `v1_6c031190c72116644994087fd38e2fae0e8870548437f56d14ac13527ce71ff0` VALUES ("カオリ（サマー）", 24, 110501, 2, 0.0, 11, 2, 0.0, 24025, "私の空手は世界最強さ～！\n夏の陽射しと青い海も合わされば、\n向かうところ敵なしだよー！", "2019/07/31 12:00:00", 10021, 0.0, "2030/12/17 14:59:59");
